import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  firstClick() {
    console.log('Primeiro botão!')
  } 

  secondClick() {
    console.log('Segundo botão!')
  }

  thirdClick() {
    console.log('Terceiro botão!')
  }

  render () {
    return <div>
        <button onClick={this.firstClick}>Primeiro botão</button>
        <button onClick={this.secondClick}>Segundo botão</button>
        <button onClick={this.thirdClick}>Terceiro Botão</button>
    </div>
  }
}

export default App;
